import React from 'react';
import ThemeSection from './sections/ThemeSection';
import imgGameOfThrones from '../assets/gameOfThrones_background.jpg';

class App extends React.Component {
  constructor(props) {
    super(props)

    this.sectionStyle = {
      backgroundImage: `url(${imgGameOfThrones})`
    }

  }

  render() {
    return (
      <section>
        <ThemeSection key="0" title="Game of Thrones" image={imgGameOfThrones}/>
      </section>
    )
  }
}

export default App;
